import './index.css';

var React = require('react');
var ReactDOM = require('react-dom');
var reportWebVitals = require('./reportWebVitals');

var App = require('./App');

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

var makeApp = require('../lib/makeApp');
var State = require('./logic/State');
var Actions = require('./logic/Actions');
var Projections = require('./logic/Projections');

var app = makeApp(State, Actions, Projections);
window.gameApp = app;

module.exports = app;

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
